import UIKit

//Problem link: https://www.hackerrank.com/challenges/sherlock-and-valid-string/problem
// Complete the isValid function below.
func isValid(s: String) -> String {
    let charsDictionary = Dictionary(grouping: Array(s), by: { $0 })
    //print(charsDictionary)
    var counts = Dictionary<Int, Int>()
    let keys = Array(charsDictionary.keys)
    keys.forEach { (character) in
        if let charCount = charsDictionary[character]?.count {
            let currentCount = counts[charCount] ?? 0
            counts[charCount] = currentCount + 1
        }
    }
    
    print(counts)
    if counts.count == 1 {
        return "YES"
    }
    if counts.count > 2 {
        return "NO"
    }
    let countKeys = Array(counts.keys)
    let key2 = countKeys[1]
    let key1 = countKeys[0]
    let dif = abs(key1 - key2)
    let maxkey = max(key1, key2)
    let minkey = min(key1, key2)
    if(counts[maxkey] == 1 && dif == 1) {
        return "YES"
    } else if (minkey == 1 && counts[minkey] == 1) {
        return "YES"
    }
    return "NO"
}

